import React, { useState, useEffect } from 'react';
import './style.css'

const CarDescription = (props) => {
  const [modelName, setBrand] = useState([]);
  const [modelState, setProfileState] = useState(props);
// console.log(props);
useEffect(() => {
  setProfileState(props);
}, [props]);
  useEffect(() => {
    const ac = new AbortController();
    fetch(
      `http://uimocks.infoedge.com/vehicles.json`,
      {
        method: "GET",
      },
    )
      .then(res => res.json())
      .then(response => {
        // console.log(response);
        setBrand(response);
      })
      .catch(ex => console.error(ex));
      return () => ac.abort();
  });

  return (
    <React.Fragment>

      {modelName.map((modelName, index) => (
        ((modelState.models == modelName.model)) && <div
          key={index}
          className={'featureCard'}
        >
          <div>{modelName.make}</div>
          <div>{modelName.model}</div>
          <div>{modelName.enginePowerPS}</div>
          <div>{modelName.enginePowerKW}</div>
          <div>{modelName.fuelType}</div>
          <div>{modelName.bodyType}</div>
          <div>{modelName.engineCapacity}</div>
        </div>
      ))}

    </React.Fragment>
  )
}

export default CarDescription;
